import React from 'react';

const AnalysisReport = () => {
  const filepath = require("./analysis_report.html");

  return (
    <div>
      <h1>Local HTML Viewer</h1>
      <iframe
        title="Local HTML File"
        src={filepath}
        width="600"
        height="400"
      />
    </div>
  );
};

export default AnalysisReport;
